import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import { Container } from 'react-bootstrap';

function App() {
  return (
    <Container fluid>
      <BrowserRouter>
      <Routes>
        <Route></Route>
      </Routes>
      </BrowserRouter>
    </Container>
  );
}

export default App;
